import React from 'react';
import Sidebar from '../../components/Sidebar';
import { Container, Content } from './styles';
import profile from '../../assets/default.png';

export default function Profile() {
  return (
    <>
      <Container>
        <Sidebar />
        <Content>
          <Profile>
            <img src={profile} alt="José da Silva" />
            <h1>José da Silva</h1>
          </Profile>
        </Content>
      </Container>
    </>
  );
}
